import React from 'react';
import {Ul, Img, Atag, H1} from '../components/index';
import {Picture} from './index';

const Main = (props) => {
  const media = [
    {
      media: '(max-width: 600px)',
      mediaSrc: './mainvisual-sp.jpg'
    },
    {
      media: '(max-width: 300px)',
      mediaSrc: './mainvisual-pc.jpg'
    }
    ]
  return (
    <React.Fragment>
      <Picture src={'./mainvisual-pc.jpg'} media={media} />
    </React.Fragment>
  );
}

export default Main;
